import './Movie.css'
import React, { useEffect, useState } from "react";

export default function Movie(){
    const [productCount, setProductCount] = useState(1);
    const [product, setProduct] = useState(null);

    function handleClick_F(event) {
        setProductCount(1);
        console.log(productCount);
    }

    function handleClick_N(event) {
        setProductCount((cnt) => cnt + 1);
        console.log(productCount);
    }

    function handleClick_P(event) {
        setProductCount((cnt) => cnt - 1);
        console.log(productCount);
    }

    function handleClick_L(event) {
        setProductCount(100);
        console.log(productCount);
    }

    return(
        <div>
            <div className='buttons'>
                <button className='button' onClick={handleClick_F}>First Page</button>
                <button className='button' onClick={handleClick_P}>Prev Page</button>
                <button className='button' onClick={handleClick_N}>Next Page</button>
                <button className='button' onClick={handleClick_L}>Last Page</button>
            </div>
        </div>
    );
}
